description:
Pyromaniac

Technology Documentary hosted by John Robinson, published by Discovery Channel broadcasted as part of DC Forensic Factor series in 2009 - English narration


Information
------------------------------

Investigating a series of fires in California's Sam Joaquin Valley that killed four, investigators determine a respected arson investigator may be the arsonist.

